(this["webpackJsonprunelite.net"]=this["webpackJsonprunelite.net"]||[]).push([[106],{384:function(e,n){e.exports={title:"1.5.33 Release",description:"Idle Movement notifications, World Map Teleport icon click jumping, and Clue fixes in Prifddinas",author:"Alexsuperfly",body:'<p>The <a href="https://github.com/runelite/runelite/wiki/World-Map" native="" rel="nofollow">World Map plugin</a> can now show you where certain teleports take you by jumping to the corresponding location when clicking on the icon in the world map</p>\n<p><img src="/img/blog/1.5.33-Release/world_map_tele_jumping.gif" alt="world_map_tele_jumping"></p>\n<p>The <a href="https://github.com/runelite/runelite/wiki/Idle-Notifier" native="" rel="nofollow">Idle Notifier plugin</a> can now notify you after not moving your character for a configurable amount of time</p>\n<p>The <a href="https://github.com/runelite/runelite/wiki/Clue-Scroll" native="" rel="nofollow">Clue Scroll plugin</a> has been updated to work correctly for coordinate and Hot/Cold clues located in the city of Prifddinas</p>\n<p>There are also several smaller improvements and bug fixes, including:</p>\n<ul>\n<li>The <a href="https://github.com/runelite/runelite/wiki/Slayer" native="" rel="nofollow">Slayer plugin</a> no longer shows the task infobox on login</li>\n<li>The <a href="https://github.com/runelite/runelite/wiki/Chat-Notifications" native="" rel="nofollow">Chat Notifications plugin</a> has had its highlighting of messages with color improved</li>\n<li>The <a href="https://github.com/runelite/runelite/wiki/Chat-Color" native="" rel="nofollow">Chat Color plugin</a> now recolors the colon after the username of private chat messages, and the friend login/logout notifications</li>\n<li>The <a href="https://github.com/runelite/runelite/wiki/Agility" native="" rel="nofollow">Agility plugin</a> now highlights shortcuts within the Kourend and Forthos dungeons</li>\n<li>The <a href="https://github.com/runelite/runelite/wiki/XP-Globes" native="" rel="nofollow">XP Globes plugin</a> has received an option to configure the tooltip information</li>\n</ul>\n<p>Enjoy!</p>\n<p>- Alexsuperfly</p>\n<h3>New commits</h3>\n<p>We had 10 contributors this release!</p>\n<pre><code>Adam (7):\n      plugin manager: fix two log format strings\n      menu entry swapper: optimize menu searching for strict matching\n      slayer plugin: do not show task infobox on login\n      chat message manager: fix recoloring messages with embedded &lt;/col&gt; tags\n      devtools: add msg command\n      chat notifications: fix matching messages with color\n      clue plugin: support Prifddinas clues\n\nAdam Witkowski (1):\n      chat: add LOGINLOGOUTNOTIFICATIONs recoloring\n\nAndrew Chow (1):\n      idle notifer: add movement idle notification\n\nDaniel Bolink (1):\n      agility shortcuts: add Forthos dungeon and Catacombs of Kourend shortcuts\n\nDavid (1):\n      timersconfig: fix typo in antipoison description (#9781)\n\nGustavo Rodrigues (1):\n      xpglobes: add configs for globe tooltips\n\nHunter Harloff (1):\n      hooks: draw ABOVE_MAP before ABOVE_WIDGETS\n\nHydrox6 (2):\n      runecraft: move rift update function to plugin\n      runecraft: move minimap code to its own overlay\n\nMax Weber (1):\n      gpu: wait for canvas to get it\'s native peer before starting OpenGL\n\nQuasindro (2):\n      worldmap: add on-click jumping for unambiguous single-target transports\n      chat: fix private chat username recolouring, improve responsiveness to config settings\n</code></pre>\n',image:"/img/blog/1.5.33-Release/world_map_tele_jumping.gif"}}}]);
